class Helper {

    static let fileManager = FileManager.default
    static let tmpFolder = NSTemporaryDirectory()
    static let bundle = Bundle(for: BaseTest.self)

    static func injectFileToTmpFolder(prefix: String, suffix: String) -> URL? {

        // Get the file path in the bundle
        if let bundleURL = bundle.url(forResource: prefix, withExtension: suffix) {

            // Create a destination URL.
            let targetURL = URL(fileURLWithPath: tmpFolder.appending("\(prefix).\(suffix)"))
            print(targetURL)

            // Copy the file.
            do {
                try fileManager.copyItem(at: bundleURL, to: targetURL)
                return targetURL
            } catch {
                print("Unable to copy file: \(error)")
            }
        }
        return nil
    }

